import React from 'react';
import { Box } from '@mui/material'

import Tabs from '@mui/material/Tabs';
import Tab from '@mui/material/Tab';

const CompanyInfoView = () => {
  const [value, setValue] = React.useState(0);
  const handleChange = (event, newValue) => {
    setValue(newValue);
  };

  return (
    <Box>
      <Box sx={{ fontSize: '20px', fontWeight: 'bold', pb : 46 }}>
        업체정보
      </Box>
      <Tabs value={value} onChange={handleChange} >
          <Tab label="Item One"  sx={{backgroundColor : '#ffffff' , borderTopLeftRadius : 10, borderStartStartRadius : 10}}/>
          <Tab label="Item Two"  sx={{backgroundColor : '#ffffff' , borderTopLeftRadius : 10, borderTopLeftRadius : 10}} />
          <Tab label="Item Three"   sx={{backgroundColor : '#ffffff' , borderTopLeftRadius : 10, borderTopLeftRadius : 10}}/>
      </Tabs>
      
    </Box>

  );
}

export default CompanyInfoView;
